(95551, 151694, 8437, 1, '漠然森林', '', '2015-03-13 00:00:00', 2000, 25, 0, 1, '1.)漠然森林\n詞/曲:壹翔 編曲:印象派鉛筆\n\n若聽見誰哭泣的聲音\n停止微笑 隨後補上了嘆息\n再沒有比這樣更容易\n停止思考 偽裝自己的透明\n\n每個人是個個體 各個都故作冷靜\n在他的世界裡看著好戲\n我沒有這種聰明 學到要如何無情\n翻天地 沉默的病\n\n從晚上陪你到天亮\n多年的驕傲配一輪月光\n倒映在傷心的海上\n儘管模糊也抹上淚光\n\n獨自出發也莫明感傷\n遠方的樹 雜亂 依舊的地方\n\n如此猖狂卻不用代價\n漠然的樹 成為理想的地方\n\n我藏呀藏呀藏呀 藏好地方\n就藏在你不相信的樹下\n等待你也等到發慌\n如今不再正確方位方向\n', '', 263, '', '', '', '', 'SeedMusic 種子音樂', '', 1, 0, 0, '2015-03-10 14:38:03', '2015-03-12 14:18:49', '0000-00-00 00:00:00'),
(95552, 151694, 8437, 2, '我對自己說', '', '2015-03-13 00:00:00', 2000, 25, 0, 1, '2.)我對自己說\n詞/曲:壹翔 編曲:印象派鉛筆\n\n你有多久沒有歌唱 很久很久沒有盡情狂妄\n你是不是為單純渴望 已經沒空為回憶悲傷\n也許這就是所謂你們說的成長\n\n我不想要再跟他吵 也不會再想像誰的嘲笑\n你只是之前沒大腦 但並不代表現在也沒有啊\n這一切對你不過 是不過就是感受 感動 敢痛的代價\n何不再一次聽心裡的話\n\n衝夢 衝動 執著 的我　　\n不該掙扎 不該怠忘\n就這樣衝出去吧\n\n猶豫 懦弱 懵懂 的我\n不該存在過去的人啊　　　　\n會偷偷地被 新一頁 蓋上\n', '', 310, '', '', '', '', 'SeedMusic 種子音樂', '', 1, 0, 0, '2015-03-10 14:39:24', '2015-03-12 14:18:49', '0000-00-00 00:00:00'),
(95553, 151694, 8437, 3, '棄守', '', '2015-03-13 00:00:00', 2000, 25, 0, 1, '3.)棄守\n詞/曲:壹翔 編曲:印象派鉛筆\n\n異樣地是虛華 吞沒了的真實 清楚地 我已被侵蝕\n\n我悄悄的回去 我只想抓住你 抓住過早棄守的細膩 \n我沒有遺憾 就這樣撤退吧\n\n詭異地 是不是有什麼在延拍\n你和我各自延續著呼吸\n思考著 你和我各自逐的夢想\n我們早疲憊的想回家\n\n有很多故事沒結局 不管你委不委屈\n不是一個人的事 雖然\n心情有如針在刺 不如放開雙手 輕輕的飄下\n也讓你輕輕的飄下\n也讓我輕輕的 飄下\n \n與其痛苦的回憶不如坦然放手\n生活不過就是種挑戰和不斷棄守\n痛得你 也全部帶走\n', '', 280, '', '', '', '', 'SeedMusic 種子音樂', '', 1, 0, 0, '2015-03-10 14:41:34', '2015-03-12 14:18:49', '0000-00-00 00:00:00'),
(95554, 151694, 8437, 4, '綠奶茶', '', '2015-03-13 00:00:00', 2000, 25, 0, 1, '4.)綠奶茶\n詞:壹翔 曲:壹翔/火山 編曲:印象派鉛筆\n\n喝了口 綠奶茶有想起了我嗎\n對於我倆的愛情我想說的只是 相信妳\n\n想起了那個飄著小雨的下午\n總會帶給我甜甜的訊息\n甜甜的茶香甜甜的妳\n甜美的氣氛甜美的心情\n\n我想要進入你的心裡想帶著妳看星星\n想要帶妳去旅行\n又或許我所做的歌曲無法讓妳在意\nbut I will let you free\n\n我愛的人就是你我想要的也是妳\n我願陪妳分擔傷心\n就算我長得不夠帥氣心思不夠細膩\n但妳會是我的唯一\n', '', 255, '', '', '', '', 'SeedMusic 種子音樂', '', 1, 0, 0, '2015-03-10 14:42:56', '2015-03-12 14:18:49', '0000-00-00 00:00:00'),
(95555, 151694, 8437, 5, '一起做夢', '', '2015-03-13 00:00:00', 2000, 25, 0, 1, '5.)一起作夢\n詞/曲:壹翔 編曲:印象派鉛筆\n\n清晨的 微涼的 藍色 的景色\n此刻的好想輕輕唱著歌\n黃昏的 不安的 紅色 擁抱著\n我們始終找尋著自己的顏色\n\n時間永遠不夠 心中的信念被掏空\n看自己 好迷惑 而我是否少了什麼\n而你是否少了什麼\n我們應該都少了什麼 一個夢\n\n我需要一個夢帶領著我\n就算一切只剩下一個夢\n時間再走無法將我左右 我們一起作夢\n一起感受有夢陪伴左右\n\n小時候愛流鼻涕的我 總是不擔心考試考什麼\n長大後吃盡苦頭的我 總得注意生活的每個動作\n', '', 321, '', '', '', '', 'SeedMusic 種子音樂', '', 1, 0, 0, '2015-03-10 14:44:27', '2015-03-12 14:18:49', '0000-00-00 00:00:00'),
